text:
배달시켰는데 한시간이나 늦고 기다렸는데 보니 잘못배달온 음식 ...휴...
다시보내주긴했지만..처음시킨곳의 이미지가..
왠만해서는 여기서 안시킬것같다..;;

만족스러웠어요.또 찾게될듯...
음식을 다 먹고나서 찍은 사진^^;
왼쪽은 석쇠불고기,오른쪽은 탕수육 소스.

늦게 리뷰를 남기네요 
잠들어서;;;;
닭갈비덮밥 양도 많고 맛있는데, 밥이 더 있어야겠도라구요
맵고 짰어요;;;;
밥을 더 넣어서 먹어야겠어요
그래도 맛있었어요....

오시다가 음식이 엎어졌나봐요;;;;
제육은 조금 매웠어용 
그래도 여전히 맛있게 잘먹었습니다....
